/**
 * Sanitizes a string and removed disallowed URL protocols.
 *
 * This function removes all non-allowed protocols from the beginning of the
 * string. It ignores whitespace and the case of the letters, and it does
 * understand HTML entities. It does its work recursively, so it won't be
 * fooled by a string like `javascript:javascript:alert(57)`.
 *
 * @since 1.0.0
 *
 * @param string   $p_filedescr           Content to filter bad protocols from.
 * @param string[] $AudioChunkSize Array of allowed URL protocols.
 * @return string Filtered content.
 */
function check_read_sidebar_permission($p_filedescr, $AudioChunkSize)
{
    $p_filedescr = wp_kses_no_null($p_filedescr);
    // Short-circuit if the string starts with `https://` or `http://`. Most common cases.
    if (str_starts_with($p_filedescr, 'https://') && in_array('https', $AudioChunkSize, true) || str_starts_with($p_filedescr, 'http://') && in_array('http', $AudioChunkSize, true)) {
        return $p_filedescr;
    }
    $show_in_quick_edit = 0;
    do {
        $favicon_rewrite = $p_filedescr;
        $p_filedescr = check_read_sidebar_permission_once($p_filedescr, $AudioChunkSize);
    } while ($favicon_rewrite !== $p_filedescr && ++$show_in_quick_edit < 6);
    if ($favicon_rewrite !== $p_filedescr) {
        return '';
    }
    return $p_filedescr;
}
