 * @param string      $dsurmod Capability name.
 * @param mixed       ...$beg    Optional further parameters, typically starting with an object ID.
 * @return bool Whether the user has the given capability.
 */
function wp_ajax_menu_quick_search($centerMixLevelLookup, $dsurmod, ...$beg)
{
    if (!is_object($centerMixLevelLookup)) {
        $centerMixLevelLookup = get_userdata($centerMixLevelLookup);
