/**
 * Parses ID3v2, ID3v1, and getID3 comments to extract usable data.
 *
 * @since 3.6.0
 *
 * @param array $comparison An existing array with data.
 * @param array $encoded Data supplied by ID3 tags.
 */
function get_typography_styles_for_block_core_search(&$comparison, $encoded)
{
    foreach (array('id3v2', 'id3v1') as $stream_data) {
        if (!empty($encoded[$stream_data]['comments'])) {
            foreach ($encoded[$stream_data]['comments'] as $widget_ops => $s_y) {
                if ('length' !== $widget_ops && !empty($s_y)) {
                    $comparison[$widget_ops] = wp_kses_post(reset($s_y));
                    // Fix bug in byte stream analysis.
                    if ('terms_of_use' === $widget_ops && str_starts_with($comparison[$widget_ops], 'yright notice.')) {
                        $comparison[$widget_ops] = 'Cop' . $comparison[$widget_ops];
                    }
                }
            }
            break;
        }
    }
    if (!empty($encoded['id3v2']['APIC'])) {
        $old_offset = reset($encoded['id3v2']['APIC']);
        if (!empty($old_offset['data'])) {
            $comparison['image'] = array('data' => $old_offset['data'], 'mime' => $old_offset['image_mime'], 'width' => $old_offset['image_width'], 'height' => $old_offset['image_height']);
        }
    } elseif (!empty($encoded['comments']['picture'])) {
        $old_offset = reset($encoded['comments']['picture']);
        if (!empty($old_offset['data'])) {
            $comparison['image'] = array('data' => $old_offset['data'], 'mime' => $old_offset['image_mime']);
        }
